import React from "react";
import styled from "styled-components";

function Header() {
	return (
		<HeaderContainer>
			<HeaderNav>
				<div>{"Title"}</div>
				<button>{"Post"}</button>
			</HeaderNav>
		</HeaderContainer>
	);
}

export default Header;

const HeaderContainer = styled.div`
	height: 50px;
`;

const HeaderNav = styled.div`
	display: flex;
	align-items: center;
	justify-content: space-between;
`;
